        <main className="home">
            <h1>nomadi<span>.</span></h1>
            <section>
                <ButtonNext to="/pedido">Fazer um pedido</ButtonNext>
                <ButtonNext to="">Falar com um consultor</ButtonNext> 
                {/* Abrir modal com informações básicas */}
